    def generate_table(self):
        num_shots = self.spinBox.value()
        self.tableWidget_3.setRowCount(num_shots)
        for row in range(num_shots):
            shot_item = QTableWidgetItem(str(row + 1))
            self.tableWidget_3.setItem(row, 0, shot_item)
            combo = QComboBox()
            combo.addItems([str(i + 1) for i in range(int(self.comboBox_n_model.currentText()))])
            self.tableWidget_3.setCellWidget(row, 1, combo)

    